import mockUserData from './mockUserData';
import mockRepoData from './mockRepoData';
import mockLangData from './mockLangData';
import langColors from './langColors';
import buildChart from './buildChart';

const backgroundColor = [
  'rgba(255, 99, 132, 0.7)',
  'rgba(54, 162, 235, 0.7)',
  'rgba(255, 206, 86, 0.7)',
  'rgba(75, 192, 192, 0.7)',
  'rgba(153, 102, 255, 0.7)',
  'rgba(255, 159, 64, 0.7)',
];
const borderColor = [
  'rgba(255, 99, 132, 1)',
  'rgba(54, 162, 235, 1)',
  'rgba(255, 206, 86, 1)',
  'rgba(75, 192, 192, 1)',
  'rgba(153, 102, 255, 1)',
  'rgba(255, 159, 64, 1)',
];

export {
  mockUserData,
  mockRepoData,
  mockLangData,
  langColors,
  backgroundColor,
  borderColor,
  buildChart,
};
